INSERT INTO `#__content` VALUES ('2', '37', 'Joomla! 3 + T3 Framework + Hikashop', 'joomla-3-t3-framework-hikashop', '<div class=\"alert alert-info\">\r\n<h1 style=\"text-align: center;\">Need a FREE shopping cart for your business?</h1>\r\n<p class=\"lead\" style=\"text-align: center;\">Then this <strong>Joomla! 3.0</strong> template which uses the excellent <strong>T3 Framework</strong> from Joomlart and incorporates the <strong>Hikashop shopping cart</strong> component is for you. This is a great starting point for anyone wanting to set up an online business.</p>\r\n</div>\r\n<p> </p>\r\n<p><img src=\"images/logo-bar-1200.jpg\" alt=\"\" style=\"display: block; margin-left: auto; margin-right: auto;\" /></p>\r\n<p> </p>\r\n<div class=\"row\">\r\n<div class=\"span4\">\r\n<div class=\"well\">\r\n<h1>Joomla! 3.0</h1>\r\n<p>Joomla! 3.0 has incorporated the Bootstrap framework which makes styling your website and components so much easier. Bootstrap is mobile ready and comes with all the latest and greatest user interface elements.</p>\r\n</div>\r\n</div>\r\n<div class=\"span4\">\r\n<div class=\"well\">\r\n<h1>T3 Framework</h1>\r\n<p>The new T3 framework from Joomlart is mobile ready, has multiple layouts feature, incorporate a Mega menu, RTL Language support and so much more. It makes creating Joomla! 3.0 templates and websites a breeze.</p>\r\n</div>\r\n</div>\r\n<div class=\"span4\">\r\n<div class=\"well\">\r\n<h1>Hikashop</h1>\r\n<p>Hikashop E-Commerce shopping cart component built for simplicity and flexibility. HikaShop provides an interface for handling languages, currencies, zones and advanced taxes to enable you to sell anywhere in the world.</p>\r\n</div>\r\n</div>\r\n</div>', '', '1', '2', '2013-03-09 02:06:42', '369', '', '2013-05-01 05:30:33', '369', '0', '0000-00-00 00:00:00', '2013-03-09 02:06:42', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":null,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":null,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":null,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"0\",\"show_modify_date\":\"0\",\"show_publish_date\":\"0\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', '69', '0', '', '', '1', '227', '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\",\"tags\":null}', '0', '*', '');
