a-backup\\\\\\/3-7-7.html\\\",\\\"releasenotes\\\":\\\"<h3>General information<\\\\\\/h3><p> This version addresses compatibility issues with Joomla! 3.0 and 3.1. Moreover, minor issues regarding the ANGIE restoration script have been addressed.<\\\\\\/p><p> If you have a problem after or before installing the component please read our <a href=\\\\\\\"https:\\\\\\/\\\\\\/www.akeebabackup.com\\\\\\/home\\\\\\/news\\\\\\/55-general\\\\\\/1502-troubleshooting-instructions-for-feb-2013-releases.html\\\\\\\"> troubleshooting page<\\\\\\/a>. These issues are more likely to occur if you try to upgrade this component while you have an older version of another component of ours still installed on your site.<\\\\\\/p><h3>PHP 5.3 is now required<\\\\\\/h3><p> This version requires PHP 5.3 or later. The rationale behind this is explained in our <a href=\\\\\\\"https:\\\\\\/\\\\\\/www.akeebabackup.com\\\\\\/home\\\\\\/news\\\\\\/55-general\\\\\\/1501-end-of-php52-support.html\\\\\\\"> statement of mid-February 2013<\\\\\\/a>. It won\'t install on hosts running PHP 5.2 or earlier. Moreover, due to the necessary Joomla! API changes found only in Joomla! 2.5.6 or later, this version will not install on Joomla! 2.5.5 or earlier versions. In any case, it will tell you exactly why it cannot be installed (minimum PHP or Joomla! version not satisfied).<\\\\\\/p><h3>Changelog<\\\\\\/h3><h4>New features<\\\\\\/h4><ul> <li>Added \\\\\\\"Robert button\\\\\\\" (accept the mandatory information in the post-setup page without ticking each box)<\\\\\\/li><\\\\\\/ul><h4>Miscellaneous changes<\\\\\\/h4><ul> <li>Making MySQLi the default database engine in ANGIE<\\\\\\/li><\\\\\\/ul><h4>Bug fixes<\\\\\\/h4><ul> <li>[LOW] ANGIE: Division by zero on dead slow servers<\\\\\\/li> <li>[LOW] ANGIE: The FTP layer\'s status sticks to the value of the backed up site<\\\\\\/li><\\\\\\/ul>\\\"}\\\"\\\"\\nstuck=0\\n\\n[update]\\nstuck=0\\nlastcheck=1369120770\\nupdatedata=\\\"\\\"{\\\\\\\"supported\\\\\\\":tr