CREATE TABLE `#__hikashop_discount` (   `discount_id` int(10) unsigned NOT NULL AUTO_INCREMENT,   `discount_type` varchar(255) NOT NULL DEFAULT 'discount',   `discount_start` int(10) unsigned NOT NULL DEFAULT '0',   `discount_end` int(10) unsigned NOT NULL DEFAULT '0',   `discount_flat_amount` decimal(17,5) NOT NULL DEFAULT '0.00000',   `discount_percent_amount` decimal(10,2) NOT NULL DEFAULT '0.00',   `discount_minimum_order` decimal(17,5) NOT NULL DEFAULT '0.00000',   `discount_quota` int(10) unsigned NOT NULL DEFAULT '0',   `discount_used_times` int(10) unsigned NOT NULL DEFAULT '0',   `discount_code` varchar(255) NOT NULL DEFAULT '',   `discount_published` tinyint(4) NOT NULL DEFAULT '0',   `discount_product_id` int(10) unsigned NOT NULL DEFAULT '0',   `discount_category_id` int(10) unsigned NOT NULL DEFAULT '0',   `discount_zone_id` int(10) unsigned NOT NULL DEFAULT '0',   `discount_currency_id` int(10) unsigned NOT NULL DEFAULT '0',   `discount_category_childs` tinyint(4) NOT NULL DEFAULT '0',   `discount_auto_load` tinyint(3) unsigned DEFAULT '0',   `discount_access` varchar(255) NOT NULL DEFAULT 'all',   `discount_tax_id` int(10) unsigned DEFAULT '0',   `discount_minimum_products` int(10) unsigned DEFAULT '0',   `discount_quota_per_user` int(10) unsigned DEFAULT '0',   `discount_coupon_nodoubling` tinyint(4) DEFAULT NULL,   `discount_coupon_product_only` tinyint(4) DEFAULT NULL,   `discount_affiliate` int(10) NOT NULL DEFAULT '0',   PRIMARY KEY (`discount_id`),   UNIQUE KEY `discount_code` (`discount_code`) ) ENGINE=MyISAM DEFAULT CHARSET=utf8;
